public String toString() {
  StringBuilder sb = new StringBuilder();
  sb.append("{ Treewalk=\"").append(TreeWalk.this.toString());
  sb.append(", pending=[");
  Iterator<TreePath> i = pending.iterator();
  if (i.hasNext()) {
    sb.append("\"").append(i.next()).append("\"");
  }
  while (i.hasNext()) {
    sb.append(", \"").append(i.next()).append("\"");
  }
  sb.append("]");
  sb.append(" }");
  return sb.toString();
}
